import React from "react";


function Footer (){
return(
    <footer className="footer" >
    <a class="nav-link" className="footer" href="https://github.com/SpencerFalor-Ward"
    >github</a>
    <a class="nav-link" className="footer" href="https://www.linkedin.com/in/spencer-falor-ward-59a16494"
    >linkedin</a>
    Copyright&copy;
</footer>

);

}

export default Footer;
